import React from 'react';
import { useNavigate } from 'react-router-dom';
import FileCloak from '../FileCloak.webp';
import './UserPage.css';

function UserPage() {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <>
      <div className='userpage-body'>
        <div className="userContainer" id="decryptForm">
            <div className="logoutButton">
                <button className="button logout-btn" onclick="logOut()">Logout</button><br></br>
            </div>
            <header>
                <img src={FileCloak} className="userpage-logo" alt="FileCloak" />
            </header>
            <form className="login-form">
                <div className="panel">
                    <div className="file-decryption">
                        <h2>Input Key</h2>
                        <div>
                            <input type="text" id="keyInput" className="input-field"/>
                        </div>
                        <h2>Input Token</h2>
                        <div>
                            <input type="text" id="tokenInput" className="input-field"/>
                        </div>
                        <button type="submit" className="decrypt-btn" value="Decrypt" id="decryptButton">Decrypt</button>
                    </div>
                </div>
            </form>
        </div>
      </div>
    </>
  );
}

export default UserPage;
